// src/AllergyCards.js
import React, { useState } from 'react';

const AllergyCards = ({ onAllergyChange }) => {
 const [selectedAllergies, setSelectedAllergies] = useState([]);

 const handleAllergyClick = (allergy) => {
    setSelectedAllergies([...selectedAllergies, allergy]);
    onAllergyChange(allergy);
 };

 return (
    <div className="cards-list">
      <div className="card" onClick={() => handleAllergyClick('Gluten')}>
        <div className="card_image">
          <img src="https://i.redd.it/b3esnz5ra34y.jpg" alt="Gluten" />
        </div>
        <div className="card_title title-white">
          <p>Gluten</p>
        </div>
      </div>
      <div className="card" onClick={() => handleAllergyClick('Dairy')}>
        <div className="card_image">
          <img src="https://i.redd.it/b3esnz5ra34y.jpg" alt="Dairy" />
        </div>
        <div className="card_title title-white">
          <p>Dairy</p>
        </div>
      </div>
      <div className="card" onClick={() => handleAllergyClick('None')}>
        <div className="card_image">
          <img src="https://i.redd.it/b3esnz5ra34y.jpg" alt="None" />
        </div>
        <div className="card_title title-white">
          <p>None</p>
        </div>
      </div>
    </div>
 );
};

export default AllergyCards;
